import React, { useState } from "react";
import "../components/wishlist.css";

const destinations = [
  { id: 1, name: "Paris", category: "City", price: 1500 ,image:"data:image/jpeg;base64,"},
  { id: 2, name: "Maldives", category: "Beach", price: 3000 ,image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRcJ60yF9pVd-1B9VrD21Z39WIJoI6CwcctBA&s"},
  { id: 3, name: "New York", category: "City", price: 1800,image:"data:image/jpeg;base64," },
  { id: 4, name: "Swiss Alps", category: "Mountains", price: 2500,image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT75dYDJ8g24zOLEDhQ67oTWx2vv1qSOhuQ-w&s" },
  { id: 5, name: "Bali", category: "Beach", price: 2000,image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQOIvGXU1q0gCdLSkyk7eJokbC2hLrGuaCWEQ&s" },
  { id: 6, name: "Bali", category: "Hotel", price: 2000,image:"data:image/jpeg;base64," },
    {id: 7, name: "Paris", category: "Hotel", price: 1500,image:"data:image/jpeg;base64," },
    { id: 8, name: "Maldives", category: "Hotel", price: 3000,image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQLy-BwbQ7P6WNp5Zc15mXreyQuoMBFPYu8ZQ&s" },
    { id: 9, name: "New York", category: "Hotel", price: 1800,image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTZv_pWBKrHTcYMNtaLVWKn9Xskdam4JkcJFA&s" },
    { id: 10, name: "Swiss Alps", category: "Hotel", price: 2500,image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT3YYlJqLrIDGp9IcximqGMAD47GkCKto1EwQ&s"}

];

const Wishlist = () => {
  const [wishlist, setWishlist] = useState([]);
  const toggleWishlist = (destination) => {
    if (wishlist.some((item) => item.id === destination.id)) {
      setWishlist(wishlist.filter((item) => item.id !== destination.id));
    } else {
      setWishlist([...wishlist, destination]);
    }
  };

  return (
    <div className="wishlist-container">
      <h2>Explore Destinations</h2>
      <div className="destinations">
        {destinations.map((destination) => (
          <div key={destination.id} className="destination-card">
            <h3>{destination.name}</h3>
            <img src={destination.image} alt={destination.title} className="img" />
            <p>Category: {destination.category}</p>
            <p>Price:{destination.price}</p>
            <button
              className={wishlist.some((item) => item.id === destination.id) ? "remove" : "add"}
              onClick={() => toggleWishlist(destination)}
            >
              {wishlist.some((item) => item.id === destination.id) ? "Remove from Wishlist" : "Add to Wishlist"}
            </button>
          </div>
        ))}
      </div>

      <h2>Your Wishlist</h2>
      {wishlist.length > 0 ? (
        <ul className="wishlist">
          {wishlist.map((item) => (
            <li key={item.id}>
              {item.name} - {item.price} 
              <button className="remove-btn" onClick={() => toggleWishlist(item)}>X</button>
            </li>
          ))}
        </ul>
      ) : (
        <p>Your wishlist is empty.</p>
      )}
    </div>
  );
};

export default Wishlist;
